import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';

function BestPrice() {
  return (
    <div className="bg">
      <Container>
        <Row>
          <text>
            Nada
            </text>
        </Row>
      </Container>
    </div>
  )
};

export default BestPrice;
